import React from "react";
import "./Sidebar.css";

const Sidebar = ({ marker, onClose }) => {
  if (!marker) return null;

  return (
    <div className="sidebar">
      <button onClick={onClose} className="close-btn">
        ✖
      </button>
      <h2>{marker.name}</h2>
      <div>주소 : {marker.address}</div>
      <div>
        총 보조금:{" "}
        {new Intl.NumberFormat("ko-KR", {
          style: "currency",
          currency: "KRW",
        }).format(marker.maxTotalSubsidy)}
      </div>
      <div>부처: {marker.govOffice || "정보 없음"}</div>
      {marker.organizations && (
        <div className="organizations-container">
          <h3>조직 상세 정보: </h3>
          {marker.organizations.map((org, index) => (
            <div key={index} className="organization-detail">
              <h4>{org.name}</h4>
              <p>대표자: {org.representative}</p>
              <p>전화번호: {org.phoneNumber}</p>
              <p>주소: {org.address}</p>
              {(Array.isArray(org.subsidies) ? org.subsidies : []).map(
                (
                  subsidy,
                  subIndex // 수정
                ) => (
                  <div key={subIndex}>
                    <div>부처: {subsidy.govOffice || "정보 없음"}</div>
                    <div>재정연도: {subsidy.financialYear || "정보 없음"}</div>
                    <div>사업연도: {subsidy.businessYear || "정보 없음"}</div>
                    <div>사업명: {subsidy.businessName || "정보 없음"}</div>
                    <div>
                      총 사업비:{" "}
                      {new Intl.NumberFormat("ko-KR", {
                        style: "currency",
                        currency: "KRW",
                      }).format(subsidy.totalBusinessExpense || 0)}
                    </div>
                    <div>
                      정부 지원금:{" "}
                      {new Intl.NumberFormat("ko-KR", {
                        style: "currency",
                        currency: "KRW",
                      }).format(subsidy.govExpense || 0)}
                    </div>
                    <div>
                      지방 자치단체 지원금:{" "}
                      {new Intl.NumberFormat("ko-KR", {
                        style: "currency",
                        currency: "KRW",
                      }).format(subsidy.localExpense || 0)}
                    </div>
                    <div>
                      자부담금:{" "}
                      {new Intl.NumberFormat("ko-KR", {
                        style: "currency",
                        currency: "KRW",
                      }).format(subsidy.selfExpense || 0)}
                    </div>
                    <div>
                      신청 보조금: {subsidy.requestedSubsidy || "정보 없음"}
                    </div>
                    <div>
                      정부 예산:{" "}
                      {new Intl.NumberFormat("ko-KR", {
                        style: "currency",
                        currency: "KRW",
                      }).format(subsidy.govBudget || 0)}
                    </div>
                    <div>
                      지방 자치단체 예산:{" "}
                      {new Intl.NumberFormat("ko-KR", {
                        style: "currency",
                        currency: "KRW",
                      }).format(subsidy.localBudget || 0)}
                    </div>
                    <div>
                      지급된 보조금:{" "}
                      {new Intl.NumberFormat("ko-KR", {
                        style: "currency",
                        currency: "KRW",
                      }).format(subsidy.requestedPaid || 0)}
                    </div>
                    <div>
                      권한 지급금:{" "}
                      {new Intl.NumberFormat("ko-KR", {
                        style: "currency",
                        currency: "KRW",
                      }).format(subsidy.authorityPaid || 0)}
                    </div>
                    <div>
                      사업 목적: {subsidy.businessPurpose || "정보 없음"}
                    </div>
                    <div>
                      사업 설명: {subsidy.businessDescription || "정보 없음"}
                    </div>
                    <div>
                      사업 기간: {subsidy.businessDuration || "정보 없음"}
                    </div>
                    <div>
                      사업 위치: {subsidy.businessLocation || "정보 없음"}
                    </div>
                  </div>
                )
              )}
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default Sidebar;
